import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { View, Text, Button, StyleSheet } from 'react-native';

function OrderLists() {   
  let tripData = [
    {
      "tripID": "00001",
      "tripInfo": {
        "dropOff": "Yangon",
        "desVal": "Bangkok",
        "dropOffDate": "25/07/2022",
        "pickUpDate": "25/08/2022",
        "dropOffAddress": "Dawbon",
        "secdropOffAddress": "",
        "pickUpAddress": "Chin Mai",
        "secpickUpAddress": "",
        "facilityInfo": "Facility Info"
      },
      "categoryLists": [
        {
          "category": "Phone",
          "item": "mobile-alt",
          "weight": "lb",
          "price": "200",
          "currency": "USD"
        }, 
        {
          "category": "General Item",
          "item": "box",
          "weight": "lb",
          "price": "1000",
          "currency": "USD"
        }
      ],
      "prohibitedLists": [
        {
          "category": "Radioactive materials",
          "item": "fan",
        }, 
        {
          "category": "Strong Acid",
          "item": "flask",
        }],
        "trackingStatus" : "On Route"     
    },
    {
      "tripID": "00002",
      "tripInfo": {
        "dropOff": "Yangon",
        "desVal": "LOS ANGELES",
        "dropOffDate": "24/07/2022",
        "pickUpDate": "29/08/2022",
        "dropOffAddress": "52 Baho Road, Sanchaung Tsp.,Yangon",
        "secdropOffAddress": "",
        "pickUpAddress": "46-03 11th street, Elmhurst, NY, 11373",
        "secpickUpAddress": "",
        "facilityInfo": "Facility Info"
      },
      "categoryLists": [
        {
          "category": "Phone",
          "item": "mobile-alt",
          "weight": "lb",
          "price": "200",
          "currency": "USD"
        }, 
        {
          "category": "General Item",
          "item": "box",
          "weight": "lb",
          "price": "1000",
          "currency": "USD"
        }
      ],
      "prohibitedLists": [
        {
          "category": "Radioactive materials",
          "item": "fan",
        }, 
        {
          "category": "Strong Acid",
          "item": "flask",
        }],
        "trackingStatus" : "Reserved"   
    },
    {
      "tripID": "00003",
      "tripInfo": {
        "dropOff": "Yangon",
        "desVal": "SINGAPORE",
        "dropOffDate": "24/07/2022",
        "pickUpDate": "29/08/2022",
        "dropOffAddress": "52 Baho Road, Sanchaung Tsp.,Yangon",
        "secdropOffAddress": "",
        "pickUpAddress": "46-03 11th street, Elmhurst, NY, 11373",
        "secpickUpAddress": "",
        "facilityInfo": "Facility Info"
      },
      "categoryLists": [
        {
          "category": "Phone",
          "item": "mobile-alt",
          "weight": "lb",
          "price": "200",
          "currency": "USD"
        }, 
        {
          "category": "General Item",
          "item": "box",
          "weight": "lb",
          "price": "1000",
          "currency": "USD"
        }
      ],
      "prohibitedLists": [
        {
          "category": "Radioactive materials",
          "item": "fan",
        }, 
        {
          "category": "Strong Acid",
          "item": "flask",
        }],
        "trackingStatus" : "Received"    
    }
];
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.mainText}> ORDER </Text>
        <Text style={styles.text}> TRIP LIST  </Text>
      </View>
      <View style={styles.itemLists}>
        {tripData.map((item, index) => (
          <View style={styles.item} key={index}>
            <View style={styles.tripHeader}> 
              <Text style={styles.title}>TRIP NUMBER - {item.tripID} | </Text>
              <Text style={styles.title}>Tracking : {item.trackingStatus}</Text>
            </View>
            <View style={styles.tripList}>
              <View style={{flex: 2}}>
                <Text style={styles.triplabel}>From</Text>
                <Text style={styles.tripname}>{item.tripInfo.dropOff}</Text>
              </View>
              <View style={{flex: 2}}>
                <Text style={styles.triplabel}>To</Text>
                <Text style={styles.tripname}>{item.tripInfo.desVal}</Text>
              </View>
              <View style={{flex: 3, alignItems: "flex-end", justifyContent: "center"}}>
                <Text style={styles.tripStatus}>{item.trackingStatus}</Text>
              </View>
              </View>
          </View> 
        ))} 
       </View>
      <Button title="Go to Home" onPress={() => navigation.navigate('HOME')} />
    </View>
  );
} 

const RootStack = createNativeStackNavigator();
export default function OrderScreen(info) {
  console.log(info.data)
  return (
    <NavigationContainer independent={true}>
      <RootStack.Navigator>
        <RootStack.Screen name="OrderLists" component={OrderLists} options={{headerShown: false }}  initialParams={{currentCity: 'Yangon'}} />
        {/* <RootStack.Screen name="CreateFacility" component={FacilityCreateScreen} options={{headerShown: false}}/> */}
      </RootStack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,  
    marginHorizontal: 20
  },
  header: {
    flex: 1,
    flexDirection: 'column', 
    paddingVertical: 60
  },
  mainText: {
    fontSize: 25,
    fontFamily: 'UbuntuBold',
    paddingLeft: 5, 
  },
  text: {
    fontSize: 18,
    fontFamily: 'UbuntuBold',
    padding : 10,
  },
  itemLists:{ 
    flex: 3,
  },
  item: {
    color: "#185354",
    fontSize: 14,
    backgroundColor: "#FFFFFF",
    shadowColor: 'rgba(0,0,0,0.25)',
    shadowOffset: {width: 1, height: 4},
    shadowOpacity: 0.2,
    shadowRadius: 3,
    borderRadius: 10,
    paddingHorizontal: "5%",
    paddingVertical: "5%",
    marginBottom: "2%",
  },
  title: {
    marginBottom: 10,
    color: "#185354",
    fontSize: 14,
    fontFamily: "UbuntuBold",
  },
  tripHeader:{ 
    display: "flex",
    flexDirection: "row",
    justifyContent: 'space-between', 
    borderBottomColor: '#E5F1F2',
    borderBottomWidth: 2,
    marginBottom: "2%",
  },
  tripList: {
    display: "flex",
    flexDirection: "row"
  },
  tripStatus: {
    color: "#185354",
    fontSize: 20
  },
  triplabel: {
    fontSize: 12,
    marginBottom: 10,
    color: "rgba(23,25,48,0.6)"
  },
  tripname: {
    textTransform: "uppercase",
    fontFamily: "UbuntuMedium",
  }
});
